import styled from 'styled-components';

const StyleFileIndex = styled.div`
    

    .file-view {
        padding-top: 2rem;
    }

    .box{
        background-color: #333333;
        color: #fff;
    }
    .btn-download{
        color: #fff;
        border: 1px solid white;
    }
    .search-box{
        margin-bottom:2rem;
    }
    .searchByName{
        color: #fff;
    }
    .btn-search{
        border: 1px solid white;
    }
    .btn-upload{
        float:right;
        margin-bottom: 1rem;
    }
    
`

export {StyleFileIndex};
